wwv_flow_imp_page.create_page_process(
 p_id=>wwv_flow_imp.id(7402841103604033)
,p_process_sequence=>10
,p_process_point=>'ON_SUBMIT_BEFORE_COMPUTATION'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'actualizar nominas'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'  v_fecha_ini DATE := :P13_F_FIN; ',
'  v_fecha_fin DATE := :P13_NEW_F_FIN;',
'  v_total_meses      PLS_INTEGER;',
'  v_meses_generados  PLS_INTEGER := 0;',
'  v_mes_actual       DATE;',
'',
'  v_ret_mes NUMBER := :P13_NEW_SAL;',
'  v_ss_mes NUMBER := :P13_NEW_SS;',
'  v_indemnizacion NUMBER := :P13_NEW_IND;',
'',
'  v_dni VARCHAR2(9);',
'',
'  v_ultimo_mes DATE;',
'',
'',
'BEGIN',
'  EXECUTE IMMEDIATE ''ALTER SESSION SET NLS_NUMERIC_CHARACTERS = '''',.'''''';',
'   ',
'  --  Obtengo el DNI desde la tabla CONTRATO',
'  SELECT CONTRATADO',
'  INTO v_dni',
'  FROM CONTRATOS',
'  WHERE REF_CONTRATO = :P13_SEL_CONT;',
'',
unistr('  -- Actualizo la nueva fecha fin del contrato e importes a\00F1ado observaci\00F3n de renovaci\00F3n.'),
'',
'UPDATE CONTRATOS',
'SET ',
'  F_FIN = :P13_NEW_F_FIN,',
'  RET_MES = :P13_NEW_SAL,',
'  SS_MES = :P13_NEW_SS,',
'  INDEMNIZACION = :P13_NEW_IND,',
'  OBSERVACIONES = ''Renovado''',
'WHERE REF_CONTRATO = :P13_SEL_CONT;',
'',
unistr('  -- Buscamos el \00FAltimo mes insertado anteriormente'),
'  SELECT TO_DATE(anno || LPAD(mes, 2, ''0''), ''YYYYMM'')',
'  INTO v_ultimo_mes',
'  FROM (',
'    SELECT mes, anno',
'    FROM NOMINA',
'    WHERE dni_nom = v_dni',
'    ORDER BY anno DESC, mes DESC',
'  )',
'  WHERE ROWNUM = 1;',
'',
unistr('  -- Actualizar nueva retribuci\00F3n del primer nuevo mes'),
'  UPDATE NOMINA',
'  SET mensualidad = v_ret_mes',
'  WHERE dni_nom = v_dni',
'    AND mes = TO_NUMBER(TO_CHAR(v_ultimo_mes, ''MM''))',
'    AND anno = TO_NUMBER(TO_CHAR(v_ultimo_mes, ''YYYY''));',
'',
'  -- Calculo de nuevos meses a generar',
'  v_total_meses := MONTHS_BETWEEN(TRUNC(v_fecha_fin, ''MM''), ADD_MONTHS(TRUNC(v_ultimo_mes, ''MM''), 1)) + 1;',
'',
unistr('  -- Inserci\00F3n nuevos meses con salario y SS'),
'  WHILE v_meses_generados < v_total_meses LOOP',
'    v_mes_actual := ADD_MONTHS(TRUNC(v_ultimo_mes, ''MM''), v_meses_generados + 1);',
'',
'    INSERT INTO NOMINA (',
'      dni_nom, mes, anno, mensualidad, seg_soc, observaciones',
'    ) VALUES (',
'      v_dni,',
'      TO_NUMBER(TO_CHAR(v_mes_actual, ''MM'')),',
'      TO_NUMBER(TO_CHAR(v_mes_actual, ''YYYY'')),',
'      v_ret_mes,',
'      v_ss_mes,',
'      NULL',
'    );',
'',
'    v_meses_generados := v_meses_generados + 1;',
'  END LOOP;',
'',
unistr('  -- Insertar el \00FAltimo mes adicional solo con la indemnizaci\00F3n'),
'  v_mes_actual := ADD_MONTHS(TRUNC(v_ultimo_mes, ''MM''), v_total_meses + 1);',
'',
'  INSERT INTO NOMINA (',
'    dni_nom, mes, anno, mensualidad, seg_soc, observaciones',
'  ) VALUES (',
'    v_dni,',
'    TO_NUMBER(TO_CHAR(v_mes_actual, ''MM'')),',
'    TO_NUMBER(TO_CHAR(v_mes_actual, ''YYYY'')),',
'    v_indemnizacion,',
'    v_ss_mes,',
unistr('    ''Indemnizaci\00F3n final'''),
'  );',
'END;',
'',
''))
,p_process_clob_language=>'PLSQL'
,p_process_error_message=>unistr('No se ha podido realizar la renovaci\00F3n del contrato.')
,p_process_when_button_id=>wwv_flow_imp.id(7402735768604032)
,p_process_success_message=>unistr('La prorroga se ha realizado correctamente e insertado las n\00F3minas correspondientes')
,p_internal_uid=>9580114990197108
);
end;
