wwv_flow_imp_page.create_page_process(
 p_id=>wwv_flow_imp.id(9419843371727375)
,p_process_sequence=>10
,p_process_point=>'ON_SUBMIT_BEFORE_COMPUTATION'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'actualizar nominas'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'  v_fecha_ini        DATE := :P14_F_FIN; ',
'  v_fecha_fin        DATE := :P14_F_RENUNCIA;',
'  v_total_meses      PLS_INTEGER;',
'  v_meses_generados  PLS_INTEGER := 0;',
'  v_mes_actual       DATE;',
'  v_ss_mes           NUMBER := :P14_SS_OCULTA;',
'  v_indemnizacion    NUMBER := :P14_NEW_IND;',
'',
'  v_dni              VARCHAR2(9);',
'  v_ultimo_mes       DATE;',
'',
'BEGIN',
'  EXECUTE IMMEDIATE ''ALTER SESSION SET NLS_NUMERIC_CHARACTERS = '''',.'''''';',
'',
'  -- Obtengo el DNI',
'  SELECT CONTRATADO',
'  INTO v_dni',
'  FROM CONTRATOS',
'  WHERE REF_CONTRATO = :P14_SEL_CONT;',
' DBMS_OUTPUT.PUT_LINE(''DNI obtenido: '' || v_dni);',
'  -- Actualizo la fecha fin del contrato',
'  UPDATE CONTRATOS',
'  SET ',
'    F_FIN = :P14_F_RENUNCIA,',
'    INDEMNIZACION = v_indemnizacion,',
'    OBSERVACIONES = ''Renuncia''',
'  WHERE REF_CONTRATO = :P14_SEL_CONT;',
' -- elimino nominas posteriores a la renuncia',
'  DELETE FROM NOMINA',
'  WHERE dni_nom = v_dni',
'    AND TO_DATE(anno || LPAD(mes, 2, ''0''), ''YYYYMM'') > TRUNC(v_fecha_fin, ''MM'');',
'',
unistr('  -- veo cual es \00FAltimo mes de n\00F3mina'),
'  SELECT TO_DATE(anno || LPAD(mes, 2, ''0''), ''YYYYMM'')',
'  INTO v_ultimo_mes',
'  FROM (',
'    SELECT mes, anno',
'    FROM NOMINA',
'    WHERE dni_nom = v_dni',
'    ORDER BY anno DESC, mes DESC',
'  )',
'  WHERE ROWNUM = 1;',
'',
unistr('  -- Actualizo \00FAltima n\00F3mina con su nueva indemnizaci\00F3n'),
'  UPDATE NOMINA',
'  SET mensualidad = v_indemnizacion,',
'      seg_soc = v_ss_mes,',
unistr('      observaciones = ''\00DAltimo mes con indemnizaci\00F3n'''),
'  WHERE dni_nom = v_dni',
'    AND TO_DATE(anno || LPAD(mes, 2, ''0''), ''YYYYMM'') = TRUNC(v_fecha_fin, ''MM'');',
'',
unistr('  -- A\00F1ado el siguiente mes con solo ss'),
'  v_mes_actual := ADD_MONTHS(TRUNC(v_fecha_fin, ''MM''), 1);',
'',
'  INSERT INTO NOMINA (',
'    dni_nom, mes, anno, mensualidad, seg_soc, observaciones',
'  ) VALUES (',
'    v_dni,',
'    TO_NUMBER(TO_CHAR(v_mes_actual, ''MM'')),',
'    TO_NUMBER(TO_CHAR(v_mes_actual, ''YYYY'')),',
'    0,',
'    v_ss_mes,',
'    ''ultima ss''',
'  );',
'',
'END;',
''))
,p_process_clob_language=>'PLSQL'
,p_process_error_message=>'No se ha podido realizar la renuncia del contrato.'
,p_process_when_button_id=>wwv_flow_imp.id(9413923774727364)
,p_process_success_message=>unistr('La RENUNCIA se ha realizado correctamente y borrado las n\00F3minas correspondientes')
,p_internal_uid=>11597117258320450
);
end;
